const Power = ({ data }) => {
    return (
        <table className="table table-striped table-bordered table-hover">
            <thead>
                <tr>
                    <th colSpan="2">Battery</th>
                </tr>
                <tr>
                    <td className="col">Current Load</td>
                    <td className="col">Capacity</td>
                </tr>
            </thead>
            {/* Add your table body content here */}
        </table>
    );
};

export default Power;
